const Post = ({element}) =>{
    return(
        <div className = "post" > 
            <h1> {element.title}</h1>
            <p> <b>Price: </b> {element.price}</p>
            <p><b>Location: </b> {element.location}</p>
            <p><b>Will Deliver: </b>{element.willDeliver ? "yes" : "no"}</p>
            <p> <b>Description: </b>{element.description}</p>
            {element.isAuthor ? <div> 
                <p><b>Messages: </b></p>
                {element.messages.map((message, index) => {return(<div>message here</div>)})}
            </div> : null}
        </div>
    )
}

export default Post;
